 Pascal's triangle is a triangular array of numbers that show patterns of numbers when you add the rows. To create Pascal's triangle in a canvas, you need to first create a canvas element, set its dimensions, and create a context, or canvas for drawing. Then you can use the PDFilling and stroke() methods to fill and polygon() method to create each triangle in the canvas.

Here is a code example:
```
array = [1];
for (var j = 1; j < rows; j++) {
    array = array.slice();
    array[0] = 1;
    for (var i = 1; i < j; i++) {
        array[i] = array[i - 1] + array[i - 2];
    }
    for (var i = j - 1; i >= 0; i--) {
        ctx.fillText(array[i], i, (j - 1) * 30);
        ctx.strokeText(array[i], i, (j - 1) * 30);
    }
    ctx.beginPath();
    ctx.moveTo(j * 30, 0);
    for (var i = 1; i <= j; i++) {
        ctx.lineTo(j * 30 + i * 30, i * 30);
    }
    ctx.closePath();
    ctx.fill()
}
```
You will need to set the `canvas` element to 'visible' to see the triangle, and set `rows` to a value greater than 1 for the triangle to appear. Note that this is just one way to create Pascal's triangle. You can use CSS for the styling if you prefer.


