 In C#, "void" is a keyword used to define a method signature. A method signature is the combination of the method name and its return type. When a method signature is defined with a "void" return type, it means that the method does not return a value and has no return statement.

For example, a method with the signature "void PrintName(string name)" would receive a string parameter named "name" and would not return a value. The following code would define a method with this signature:
```
void PrintName(string name)
{
    Console.WriteLine(name);
}
```
In this example, the method "PrintName" takes a string parameter named "name" but does not return a value. The method simply uses the Console.WriteLine method to write the parameter's value to the console.

